messages.content:
@Grzybomir hej, widzę, że portfel polkadot js można „zabezpieczyć” ledgerem, ale nie ma jeszcze stricte zadnej aplikacji na ledger live która wspiera Bittensor?
Na razie pewnie działa to na zasadzie że moge wysłać tao na adres ledgera ale one będą tam „zablokowane”, dopóki nie będzie aplikacji, prawda? Podobnie jak w przypadku Azero.
Czy wiesz może, czy są jakieś prace bądź plany, aby stworzyć aplikacje do wspierania Tao na ledgerze?
